measurements.description:
Nine very round and overlapping French Spot flowers and three buds arranged well on one arched 82cm inflorescence;
	sepals and petals white basally overlaid pink with very fine fuchsia pink spots, heavier centrally;
	lip side lobes white veined with red centrally, yellow distally, midlobe white with fuchsia pink and yellow blotching,
	calli yellow overlaid with fuchsia pink spots; column white overlaid with fuchsia pink; substance firm; texture crystalline.
